import React from "react";
import { Transition } from "react-transition-group";

import "./Hall.css";

const Hall = props => {
	return (
		<Transition timeout={800} in={true} appear={true} mountOnEnter>
			{status => (
				<main
					className={`side-wrapper-animated flex bg-black pageTransition-${status}`}
				>
					<div className={`textTransition-${status}`}>
						<h3 className="md-txt">
							Hall <span className="upper">of</span> Fame
						</h3>
						<p>John Snow Bandeira</p>
						<p>Cersei de Jesus</p>
						<p>White Walker da Silva</p>
						<p>Ayra dos Santos</p>
					</div>
				</main>
			)}
		</Transition>
	);
};

export default Hall;
